import React from 'react';
import User from './user';

import './userslist.css'

const users = [{
    userID: 0,
    userName: 'User1',
    userAvatar: null,

}, {
    userID: 1,
    userName: 'User2',
    userAvatar: null,

}, {
    userID: 2,
    userName: 'User3',
    userAvatar: null,

}, {
    userID: 3,
    userName: 'User4',
    userAvatar: null,

}]

function UsersList() {
    return (
        <div className='userslist-container'>
            <div>
                {users.map((item) => (
                    <User user={item} />
                ))}
            </div>
        </div>
    );
}

export default UsersList;
